export default function ChatList() {
    const [msgs, setMsgs] = useState([]);
    return (
        <section className="chat-list">
            {msgs.length && <ul className="clean-list">
                {msgs.map(msg => {
                    return (
                        <li className="chat-item">
                            <p>{msg.txt}</p>
                        </li>
                    )
                })}
            </ul>}
            {}
        </section>
    )
}
